print(f"\n\tAmount of data in the histogram = {data.size}\n\n")

print(f"\tMin value ========== {np.min(data)}\n")
print(f"\tMax value ========== {np.max(data)}\n")
print(f"\tArithmetic mean ==== {np.mean(data)}\n")
print(f"\tAverage median ===== {np.median(data)}\n")
print(f"\tStandard deviation = {np.std(data)}\n")
print(f"\tVariance =========== {np.var(data)}\n")

plt.hist(data, bins = np.arange(min(data), max(data) + 2, 1), density=True)

